import React from 'react';

const actor = 'shyam';

const dancer = 'rajput';

function firstCom() {
  let name = 'ShyamRaj';
  return name;
}

function secondCom() {
  let name2 = 'ShyamRaj';
  return name2;
}

// export default actor;
export { actor, dancer, firstCom, secondCom };
